import React from "react";
import { Link } from "react-router-dom";

export default function Product({ product, category }) {
  return (
    <div>
      <Link to={`/products/${product.id}`}>{product.name}</Link>
      <div>{category ? category.name : ""}</div>
    </div>
  );
}
